                        <div class="box">
                            <pre id="col_1_in_sample_tab-freq-value-list"
                                data-copy-text="[&#39;A little bit funky and unsettled when you pop the screwcap, but soon it finds its floral, blueberry base. Remains superficial and sweet in the mouth, with candied flavors, vanilla and mild oak. Highly regular; could use more concentration and density.&#39;, &#39;92-94 Barrel sample. A rounded wine, its tannins submerged into the ripe fruits. It feels soft, and there is just a bite of alcohol. The structure is soft, generous, opulent.&#39;, &#34;86-88 This could work as a rich wine, because there is good structure and piles of botrytis. It could be delicious, with its lovely dry finish, but that&#39;s for the future.&#34;, &#39;Powerful in Zinny character, this blend of Dry Creek and Russian River grapes bursts with brawny flavors of wild berries, chocolate-covered mint, tobacco and pepper, wrapped into sturdy tannins. Shows real class and character.&#39;, &#39;Sweet cherry and baking vanilla aromas are followed by layers of plum, raspberry and spice in this kosher Bordeaux blend from Israel. The wine offers firm tannins and a lingering finish.&#39;, &#34;Gibilmoro, a pure expression of Nero d&#39;Avola, sees some oak aging to shape aromas of toasted walnut, nutella and wood spice. In fact, not much of the natural fruit is left, and what is there feels jammy and ripe.&#34;, &#39;This dense and dark wine offers spice and toast flavors. It has a big, generous feel, leaving room both for the dry, still-young tannins and for aromatic blackberry fruits. It does need to age, so drink from 2017.&#39;, &#39;Bright pink in color, a caramel flavor resting on taut strawberries and a fresh berry character. There is a touch of apple to go with the light, bright style. Drink this year.&#39;, &#34;While honey and white peach flavors ring pure and sweet, there&#39;s a slatey, mineral tone that penetrates deeply in this off-dry Kabinett. It&#39;s nervy and brisk, finishing long with zesty lime pith bitterness.&#34;, &#34;Granular, raisiny and heavy on the nose, with jammy blackberry aromas. The palate then hits with a thud; it&#39;s chunky and low in acidity, which yields a thick flavor set of prune and coffee. Better once it breathes, but it&#39;s still a bit too sticky and syrupy for our liking.&#34;]">[&#39;A little bit funky and unsettled when you pop the screwcap, but soon it finds its floral, blueberry base. Remains superficial and sweet in the mouth, with candied flavors, vanilla and mild oak. Highly regular; could use more concentration and density.&#39;, &#39;92-94 Barrel sample. A rounded wine, its tannins submerged into the ripe fruits. It feels soft, and there is just a bite of alcohol. The structure is soft, generous, opulent.&#39;, &#34;86-88 This could work as a rich wine, because there is good structure and piles of botrytis. It could be delicious, with its lovely dry finish, but that&#39;s for the future.&#34;, &#39;Powerful in Zinny character, this blend of Dry Creek and Russian River grapes bursts with brawny flavors of wild berries, chocolate-covered mint, tobacco and pepper, wrapped into sturdy tannins. Shows real class and character.&#39;, &#39;Sweet cherry and baking vanilla aromas are followed by layers of plum, raspberry and spice in this kosher Bordeaux blend from Israel. The wine offers firm tannins and a lingering finish.&#39;, &#34;Gibilmoro, a pure expression of Nero d&#39;Avola, sees some oak aging to shape aromas of toasted walnut, nutella and wood spice. In fact, not much of the natural fruit is left, and what is there feels jammy and ripe.&#34;, &#39;This dense and dark wine offers spice and toast flavors. It has a big, generous feel, leaving room both for the dry, still-young tannins and for aromatic blackberry fruits. It does need to age, so drink from 2017.&#39;, &#39;Bright pink in color, a caramel flavor resting on taut strawberries and a fresh berry character. There is a touch of apple to go with the light, bright style. Drink this year.&#39;, &#34;While honey and white peach flavors ring pure and sweet, there&#39;s a slatey, mineral tone that penetrates deeply in this off-dry Kabinett. It&#39;s nervy and brisk, finishing long with zesty lime pith bitterness.&#34;, &#34;Granular, raisiny and heavy on the nose, with jammy blackberry aromas. The palate then hits with a thud; it&#39;s chunky and low in acidity, which yields a thick flavor set of prune and coffee. Better once it breathes, but it&#39;s still a bit too sticky and syrupy for our liking.&#34;]</pre>

