            [i, j] = next(i, j);
            while (!stop(i, j)) {
                const cell = this.elem.querySelector(`[data-spans__${i}__${j}]`);
                if (cell !== null && cell.id !== startCellId && !cell.hasAttribute(
                    "data-excluded-by-column-filter") && cell.dataset.role !==
                    "padding" && cell.dataset.role !== "ellipsis") {
                    return cell.id;
