                j) => (j < this
                    .startJ));
        }
        findCellRight(startCellId, i, j) {
            return this.findNextCell(startCellId, i, j, (i, j) => [i, j + 1], (i,
                j) => (this
                    .stopJ <= j));
        }

        findCellUp(startCellId, i, j) {
            return this.findNextCell(startCellId, i, j, (i, j) => [i - 1, j], (i,
                j) => (i < this
                    .startI));
        }

        findCellDown(startCellId, i, j) {
            return this.findNextCell(startCellId, i, j, (i, j) => [i + 1, j], (i,
                j) => (this
                    .stopI <= i));
